import React from 'react';
import { Form, Button, Row, Container } from 'react-bootstrap';
import { Col } from 'react-bootstrap';

const Index = () => {
    const fecha = new Date();
    return (
        <Form >
            <h4>{'$fecha'}</h4>

            <Button variant="primary" type="submit">
                Sign In
            </Button>
        </Form>
    );
}

export default Index;
